import{_ as i,c as e,o as t,a as l}from"./app.b7fe8946.js";const m=`{"title":"Troubleshooting","description":"","frontmatter":{"sidebarDepth":2},"headers":[{"level":2,"title":"Installation Issues","slug":"installation-issues"},{"level":3,"title":"App Not Installing","slug":"app-not-installing"},{"level":3,"title":"Installation Stuck","slug":"installation-stuck"},{"level":2,"title":"First Launch Issues","slug":"first-launch-issues"},{"level":3,"title":"Crash on First Launch","slug":"crash-on-first-launch"},{"level":3,"title":"Stuck on Initialization","slug":"stuck-on-initialization"},{"level":2,"title":"Performance Issues","slug":"performance-issues"},{"level":3,"title":"Slow Performance","slug":"slow-performance"},{"level":3,"title":"Battery Drain","slug":"battery-drain"},{"level":2,"title":"Application Issues","slug":"application-issues"},{"level":3,"title":"Applications Not Importing","slug":"applications-not-importing"},{"level":3,"title":"Applications Crashing","slug":"applications-crashing"},{"level":2,"title":"System Issues","slug":"system-issues"},{"level":3,"title":"Container Won't Boot","slug":"container-won-t-boot"},{"level":3,"title":"Network Connectivity Issues","slug":"network-connectivity-issues"},{"level":2,"title":"Advanced Troubleshooting","slug":"advanced-troubleshooting"},{"level":3,"title":"Collecting Logs","slug":"collecting-logs"},{"level":3,"title":"Reporting Issues","slug":"reporting-issues"},{"level":2,"title":"Getting Help","slug":"getting-help"}],"relativePath":"guide/troubleshooting.md","lastUpdated":1746534938335}`,o={},s=l(`<h1 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-hidden="true">#</a></h1><p>This guide addresses common issues you might encounter when using Twoyi and provides solutions to help you resolve them.</p><h2 id="installation-issues" tabindex="-1">Installation Issues <a class="header-anchor" href="#installation-issues" aria-hidden="true">#</a></h2><h3 id="app-not-installing" tabindex="-1">App Not Installing <a class="header-anchor" href="#app-not-installing" aria-hidden="true">#</a></h3><p><strong>Symptoms:</strong></p><ul><li>&quot;App not installed&quot; error message</li><li>Installation process fails to complete</li></ul><p><strong>Possible Causes and Solutions:</strong></p><ol><li><p><strong>Insufficient Storage Space</strong></p><ul><li>Check your device&#39;s available storage by going to Settings &gt; Storage</li><li>Free up space by removing unused apps or files</li><li>Try installing Twoyi again</li></ul></li><li><p><strong>Incompatible Architecture</strong></p><ul><li>Ensure you&#39;re downloading the correct APK for your device architecture (arm64-v8a)</li><li>Twoyi only supports 64-bit ARM devices</li><li>Use a system information app like &quot;CPU-Z&quot; to verify your device architecture</li></ul></li><li><p><strong>Corrupted APK File</strong></p><ul><li>Re-download the APK file from the official source</li><li>Verify the file integrity by checking the SHA256 hash if available</li></ul></li><li><p><strong>Installation Blocked by Security Settings</strong></p><ul><li>Ensure &quot;Install from Unknown Sources&quot; is enabled for your browser or file manager</li><li>On Android 8.0+, go to Settings &gt; Apps &gt; Special access &gt; Install unknown apps</li></ul></li></ol><h3 id="installation-stuck" tabindex="-1">Installation Stuck <a class="header-anchor" href="#installation-stuck" aria-hidden="true">#</a></h3><p><strong>Symptoms:</strong></p><ul><li>Installation progress bar doesn&#39;t complete</li><li>&quot;Installing...&quot; message displays for an extended period</li></ul><p><strong>Solutions:</strong></p><ol><li>Cancel the installation and try again</li><li>Restart your device and attempt the installation again</li><li>Clear the cache of the Google Play Store or the file manager you&#39;re using to install the APK</li><li>Try installing in safe mode to rule out interference from other apps</li></ol><h2 id="first-launch-issues" tabindex="-1">First Launch Issues <a class="header-anchor" href="#first-launch-issues" aria-hidden="true">#</a></h2><h3 id="crash-on-first-launch" tabindex="-1">Crash on First Launch <a class="header-anchor" href="#crash-on-first-launch" aria-hidden="true">#</a></h3><p><strong>Symptoms:</strong></p><ul><li>Twoyi closes immediately after opening</li><li>Error message about the app stopping</li></ul><p><strong>Solutions:</strong></p><ol><li><p><strong>Check System Requirements</strong></p><ul><li>Verify your device meets the <a href="/guide/requirements.html">minimum requirements</a></li><li>Ensure you have sufficient free storage and RAM</li></ul></li><li><p><strong>Clear App Data and Cache</strong></p><ul><li>Go to Settings &gt; Apps &gt; Twoyi &gt; Storage</li><li>Tap &quot;Clear Data&quot; and &quot;Clear Cache&quot;</li><li>Try launching Twoyi again</li></ul></li><li><p><strong>Reinstall the Application</strong></p><ul><li>Uninstall Twoyi completely</li><li>Restart your device</li><li>Install Twoyi again from the official source</li></ul></li></ol><h3 id="stuck-on-initialization" tabindex="-1">Stuck on Initialization <a class="header-anchor" href="#stuck-on-initialization" aria-hidden="true">#</a></h3><p><strong>Symptoms:</strong></p><ul><li>Initialization process doesn&#39;t complete</li><li>Loading screen displays for an extended period</li></ul><p><strong>Solutions:</strong></p><ol><li><p><strong>Wait Longer for First Launch</strong></p><ul><li>The first launch can take several minutes depending on your device</li><li>Be patient during the initial ROM extraction process</li></ul></li><li><p><strong>Check Storage Permissions</strong></p><ul><li>Ensure Twoyi has storage permissions granted</li><li>Go to Settings &gt; Apps &gt; Twoyi &gt; Permissions &gt; Storage</li></ul></li><li><p><strong>Force Stop and Restart</strong></p><ul><li>Go to Settings &gt; Apps &gt; Twoyi</li><li>Tap &quot;Force Stop&quot;</li><li>Launch Twoyi again</li></ul></li></ol><h2 id="performance-issues" tabindex="-1">Performance Issues <a class="header-anchor" href="#performance-issues" aria-hidden="true">#</a></h2><h3 id="slow-performance" tabindex="-1">Slow Performance <a class="header-anchor" href="#slow-performance" aria-hidden="true">#</a></h3><p><strong>Symptoms:</strong></p><ul><li>Laggy interface within Twoyi</li><li>Applications within the container run slowly</li></ul><p><strong>Solutions:</strong></p><ol><li><p><strong>Close Background Applications</strong></p><ul><li>Close unnecessary apps running on your device</li><li>Use your device&#39;s recent apps menu to close background apps</li></ul></li><li><p><strong>Limit Container Applications</strong></p><ul><li>Reduce the number of applications running simultaneously within Twoyi</li><li>Close applications within Twoyi when not in use</li></ul></li><li><p><strong>Restart Twoyi</strong></p><ul><li>Shut down and restart the Twoyi container</li><li>This can help free up resources and improve performance</li></ul></li><li><p><strong>Check for Resource-Intensive Apps</strong></p><ul><li>Some applications within Twoyi may be consuming excessive resources</li><li>Identify and remove or limit the use of these applications</li></ul></li></ol><h3 id="battery-drain" tabindex="-1">Battery Drain <a class="header-anchor" href="#battery-drain" aria-hidden="true">#</a></h3><p><strong>Symptoms:</strong></p><ul><li>Faster than normal battery depletion when using Twoyi</li><li>Device heating up during Twoyi usage</li></ul><p><strong>Solutions:</strong></p><ol><li><p><strong>Limit Background Processes</strong></p><ul><li>Close applications within Twoyi when not in use</li><li>Use the Twoyi settings to optimize performance</li></ul></li><li><p><strong>Reduce Screen Brightness</strong></p><ul><li>Lower your device&#39;s screen brightness when using Twoyi</li><li>Enable auto-brightness if available</li></ul></li><li><p><strong>Update Twoyi</strong></p><ul><li>Ensure you&#39;re using the latest version of Twoyi</li><li>Updates often include performance improvements and battery optimizations</li></ul></li></ol><h2 id="application-issues" tabindex="-1">Application Issues <a class="header-anchor" href="#application-issues" aria-hidden="true">#</a></h2><h3 id="applications-not-importing" tabindex="-1">Applications Not Importing <a class="header-anchor" href="#applications-not-importing" aria-hidden="true">#</a></h3><p><strong>Symptoms:</strong></p><ul><li>Error message when trying to import applications</li><li>Import process fails to complete</li></ul><p><strong>Solutions:</strong></p><ol><li><p><strong>Check Application Compatibility</strong></p><ul><li>Ensure the application is compatible with Android 8.1</li><li>Verify the application supports 64-bit architecture (arm64-v8a)</li></ul></li><li><p><strong>Check Storage Space</strong></p><ul><li>Ensure sufficient storage space is available within the Twoyi container</li><li>Use the file manager to check available space</li></ul></li><li><p><strong>Try Alternative Import Method</strong></p><ul><li>If importing from your device fails, try installing the APK directly</li><li>Download the APK file and use the Twoyi file manager to install it</li></ul></li></ol><h3 id="applications-crashing" tabindex="-1">Applications Crashing <a class="header-anchor" href="#applications-crashing" aria-hidden="true">#</a></h3><p><strong>Symptoms:</strong></p><ul><li>Applications within Twoyi close unexpectedly</li><li>Error messages about applications stopping</li></ul><p><strong>Solutions:</strong></p><ol><li><p><strong>Clear Application Cache</strong></p><ul><li>Open Settings within Twoyi</li><li>Go to Apps &amp; Notifications &gt; [App Name] &gt; Storage</li><li>Tap &quot;Clear Cache&quot;</li></ul></li><li><p><strong>Check for Updates</strong></p><ul><li>Ensure the application is up to date</li><li>Update the application within Twoyi if updates are available</li></ul></li><li><p><strong>Reinstall the Application</strong></p><ul><li>Uninstall the application from within Twoyi</li><li>Import or install the application again</li></ul></li><li><p><strong>Check Google Services Dependency</strong></p><ul><li>Some applications require Google Mobile Services</li><li>If the app depends on GMS, follow the <a href="/guide/gms.html">Google Mobile Services guide</a></li></ul></li></ol><h2 id="system-issues" tabindex="-1">System Issues <a class="header-anchor" href="#system-issues" aria-hidden="true">#</a></h2><h3 id="container-won-t-boot" tabindex="-1">Container Won&#39;t Boot <a class="header-anchor" href="#container-won-t-boot" aria-hidden="true">#</a></h3><p><strong>Symptoms:</strong></p><ul><li>Twoyi starts but the internal Android system doesn&#39;t boot</li><li>Black screen or stuck on boot animation</li></ul><p><strong>Solutions:</strong></p><ol><li><p><strong>Restart Twoyi</strong></p><ul><li>Force close Twoyi from your device&#39;s settings</li><li>Launch Twoyi again</li></ul></li><li><p><strong>Factory Reset</strong></p><ul><li>Open Twoyi settings</li><li>Tap &quot;Factory Reset&quot; to reset to the official internal ROM</li><li>Note: This preserves your data but resets system settings</li></ul></li><li><p><strong>Wipe All Data</strong></p><ul><li>As a last resort, use the &quot;Wipe All Data&quot; option in Twoyi settings</li><li>Note: This will erase all data within the container</li></ul></li></ol><h3 id="network-connectivity-issues" tabindex="-1">Network Connectivity Issues <a class="header-anchor" href="#network-connectivity-issues" aria-hidden="true">#</a></h3><p><strong>Symptoms:</strong></p><ul><li>Applications within Twoyi can&#39;t connect to the internet</li><li>Wi-Fi shows connected but no internet access</li></ul><p><strong>Solutions:</strong></p><ol><li><p><strong>Check Host Device Connectivity</strong></p><ul><li>Ensure your device has a working internet connection</li><li>Try accessing websites outside of Twoyi</li></ul></li><li><p><strong>Reset Network Settings</strong></p><ul><li>Open Settings within Twoyi</li><li>Go to Network &amp; Internet &gt; Reset Wi-Fi, mobile &amp; Bluetooth</li></ul></li><li><p><strong>Check VPN Interference</strong></p><ul><li>If you&#39;re using a VPN on your host device, try disabling it</li><li>Some VPNs may interfere with Twoyi&#39;s network connectivity</li></ul></li></ol><h2 id="advanced-troubleshooting" tabindex="-1">Advanced Troubleshooting <a class="header-anchor" href="#advanced-troubleshooting" aria-hidden="true">#</a></h2><h3 id="collecting-logs" tabindex="-1">Collecting Logs <a class="header-anchor" href="#collecting-logs" aria-hidden="true">#</a></h3><p>If you&#39;re experiencing persistent issues, collecting logs can help diagnose the problem:</p><ol><li><p>Enable Developer Options within Twoyi:</p><ul><li>Open Settings within Twoyi</li><li>Go to System &gt; About phone</li><li>Tap &quot;Build number&quot; seven times</li></ul></li><li><p>Enable USB Debugging:</p><ul><li>Go to System &gt; Developer options</li><li>Enable &quot;USB debugging&quot;</li></ul></li><li><p>Connect to a computer and use ADB to collect logs:</p><div class="language-"><pre><code>adb logcat &gt; twoyi_log.txt
</code></pre></div></li><li><p>Share these logs when seeking support</p></li></ol><h3 id="reporting-issues" tabindex="-1">Reporting Issues <a class="header-anchor" href="#reporting-issues" aria-hidden="true">#</a></h3><p>If you encounter issues not covered in this guide:</p><ol><li>Check the <a href="https://github.com/twoyi/twoyi/issues" target="_blank" rel="noopener noreferrer">GitHub Issues</a> to see if the problem has been reported</li><li>If not, create a new issue with: <ul><li>A detailed description of the problem</li><li>Steps to reproduce the issue</li><li>Your device information (model, Android version)</li><li>Logs if available</li></ul></li></ol><h2 id="getting-help" tabindex="-1">Getting Help <a class="header-anchor" href="#getting-help" aria-hidden="true">#</a></h2><p>If you need additional assistance:</p><ul><li>Join the <a href="/guide/community.html">Twoyi Community</a> for support from other users</li><li>Contact the developers directly through the <a href="/guide/contact.html">Contact</a> page</li><li>Check the <a href="/guide/faq.html">FAQ</a> for answers to common questions</li></ul>`,67),n=[s];function a(r,p,u,c,g,h){return t(),e("div",null,n)}var y=i(o,[["render",a]]);export{m as __pageData,y as default};
